import React, { useState, useEffect } from 'react';
import { DragDropContext, Droppable, Draggable } from 'react-beautiful-dnd';
import { fetchCustomers, fetchJobs } from './api';
import { saveRoute } from './api';
import Header from '../../components/Header';

const BuildRoutes = () => {
  const [customers, setCustomers] = useState([]);
  const [jobs, setJobs] = useState([]);
  const [routes, setRoutes] = useState([]);
  const [successMessage, setSuccessMessage] = useState(null);

  useEffect(() => {
    const loadInitialData = async () => {
      const [fetchedCustomers, fetchedJobs] = await Promise.all([fetchCustomers(), fetchJobs()]);
      setCustomers(fetchedCustomers);
      setJobs(fetchedJobs);
    };
    loadInitialData();
  }, []);

  const onDragEnd = (result) => {
    const { source, destination } = result;

    if (!destination) return;

    const sourceList = source.droppableId === 'customersList' ? customers : jobs;
    const destList = destination.droppableId === 'route' ? routes : sourceList;
    const [movedItem] = sourceList.splice(source.index, 1);

    destList.splice(destination.index, 0, movedItem);

    if (source.droppableId === 'customersList') {
      setCustomers([...sourceList]);
    } else {
      setJobs([...sourceList]);
    }

    if (destination.droppableId === 'route') {
      setRoutes([...destList]);
    }
  };

  const saveNewRoute = async () => {
    await saveRoute(routes);
    setRoutes([]);
    setSuccessMessage('Route saved successfully!');
    setTimeout(() => setSuccessMessage(null), 3000);
  };

  return (
    <div className="min-h-screen bg-background text-text">
      <Header />
      <main className="max-w-7xl mx-auto py-6 sm:px-6 lg:px-8">
        <div className="px-4 py-6 sm:px-0">
          <h1 className="text-2xl font-bold mb-4">Build Routes</h1>
          {successMessage && (
            <div className="bg-green-100 border-l-4 border-green-500 text-green-700 p-4 mb-4" role="alert">
              <p>{successMessage}</p>
            </div>
          )}
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <div className="bg-surface p-4 rounded shadow">
              <h3 className="text-lg leading-6 font-medium">Customers</h3>
              <Droppable droppableId="customersList">
                {(provided) => (
                  <ul {...provided.droppableProps} ref={provided.innerRef} className="min-h-[300px] max-h-[400px] overflow-auto">
                    {customers.map((customer, index) => (
                      <Draggable key={customer._id} draggableId={customer._id} index={index}>
                        {(provided) => (
                          <li
                            ref={provided.innerRef}
                            {...provided.draggableProps}
                            {...provided.dragHandleProps}
                            className="bg-white p-2 mb-2 rounded shadow text-gray-800"
                          >
                            {customer.name} - {customer.address.street}, {customer.address.city}, {customer.address.state} {customer.address.zipCode}
                          </li>
                        )}
                      </Draggable>
                    ))}
                    {provided.placeholder}
                  </ul>
                )}
              </Droppable>
            </div>

            <div className="bg-surface p-4 rounded shadow">
              <h3 className="text-lg leading-6 font-medium">Jobs</h3>
              <Droppable droppableId="jobsList">
                {(provided) => (
                  <ul {...provided.droppableProps} ref={provided.innerRef} className="min-h-[300px] max-h-[400px] overflow-auto">
                    {jobs.map((job, index) => (
                      <Draggable key={job._id} draggableId={job._id} index={index}>
                        {(provided) => (
                          <li
                            ref={provided.innerRef}
                            {...provided.draggableProps}
                            {...provided.dragHandleProps}
                            className="bg-white p-2 mb-2 rounded shadow text-gray-800"
                          >
                            {job.title} - {job.description}
                          </li>
                        )}
                      </Draggable>
                    ))}
                    {provided.placeholder}
                  </ul>
                )}
              </Droppable>
            </div>
          </div>

          <div className="bg-surface p-4 rounded shadow mt-4">
            <h3 className="text-lg leading-6 font-medium">Route</h3>
            <Droppable droppableId="route">
              {(provided) => (
                <ul {...provided.droppableProps} ref={provided.innerRef} className="min-h-[300px] max-h-[400px] overflow-auto">
                  {routes.map((item, index) => (
                    <Draggable key={item._id} draggableId={item._id} index={index}>
                      {(provided) => (
                        <li
                          ref={provided.innerRef}
                          {...provided.draggableProps}
                          {...provided.dragHandleProps}
                          className="bg-white p-2 mb-2 rounded shadow text-gray-800"
                        >
                          {item.name || item.title} - {item.address?.street || item.description}, {item.address?.city}
                        </li>
                      )}
                    </Draggable>
                  ))}
                  {provided.placeholder}
                </ul>
              )}
            </Droppable>
          </div>

          <button onClick={saveNewRoute} className="mt-4 bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600">
            Save Route
          </button>
        </div>
      </main>
    </div>
  );
};

export default BuildRoutes;
